import { Input } from "antd";


function InputTask({ onAdd }) {

    function submitTask(event) {
        if (event) {
            onAdd(event);
            event.target.value = "";
        }   
    }

    return (
        <Input.Search id="list-task"
            className="something"
            placeholder="Your task..."
            allowClear
            enterButton="Add"
            onSearch={submitTask}
        />
    );
}

export default InputTask;
